webpackJsonp([85152635550876],{678:function(e,t){e.exports={data:{markdownRemark:{html:'<p>   During the Third Age, growing fearful of the rise of power of the\nNecromancer in Dol Guldur, Thranduil the King of the Silvan Elves abandoned\nhis city-palace in the Mountains of Mirkwood (Caras Amarth) and re-established\nhimself further to the north (at the present site of the Elven Halls). The\nlost valley of Nan-Neldoroth ("The Valley of the Beech Trees") was once part\nof the  extensive palace grounds of Caras Amarth. The great, vaulted,\ncathedral-like avenues of this parkland still boast the  unique and almost\nent-like beech trees of gold and silver. After the abandonment of the elves\nthe trees reverted to the wild and dominate the wildlife of the valley.</p>\n<p>Aeglos, Sage and Scribe of Loth Lanath.</p>',frontmatter:{title:"The Valley of the Golden Beech"}}},pathContext:{path:"/books/valleyofthegoldenbeech"}}}});
